import React from 'react';

const Footer = () => {
    return (
        <div>
           <nav className="navbar text-bg-dark">
                <div className="container-fluid">
                    <a className="navbar-brand text-center">Navbar</a>
            
                </div>
            </nav>
        </div>
    );
}

export default Footer;
